import nikklaus from './nikklaus.jpg'
import PhotoCameraIcon from '@material-ui/icons/PhotoCamera';
import VideocamIcon from '@material-ui/icons/Videocam';
const Posts = () => {
    return ( 
        <Grid container style={{marginTop:'20px'}}>
          <div className="avatar"> <Avatar style={{height:'60px',width:'60px',marginLeft:'20px'}} src={nikklaus}/> 
          </div> 
         <div> 
             <input style={{width:'400px',height:'30px',marginTop:'10px', borderRadius:'99px', paddingLeft:'20px',marginLeft:'10px', borderColor:"white",borderBlockEndColor:"grey"}} type="text" placeholder="What's on your mind dawg?"/>
             <PhotoCameraIcon style={{fontSize:'50px',marginLeft:'5px', marginTop:'10px'}}/>
             <PhotoLibraryIcon/>
             <VideocamIcon/>
             </div> 
             <div>
         
             </div>
        </Grid>

 

);
}

export default Posts;
